  selector: 'app-root',
  templateUrl: './app.component.html',
  styleUrls: ['./app.component.css']
})
export class AppComponent implements OnInit{

  constructor(){};



  ngOnInit(): void {
    throw new Error('Method not implemented.');
  }

  title = 'pokedex';
}
<app-header style="z-index: 1;"></app-header>
<video class="fixed inset-0 z-0 opacity-50" autoplay loop muted onloadeddata="this.play()">
    <source src="assets/videoSfondo.mp4" type="video/mp4">
